import React from "react";
import Login from "./registeration/Login";
import Header from "./Header";
import Footer from "./Footer";
import { Divider, Typography } from "@mui/material";
import './Homepage.css';
import Signup from './registeration/Signup'

function Homepage(props) {
    var isregister = props.isregister;

    function handlecreate()
    {
        console.log('create account clicked')
        isregister=true;

    }

        return( 
            <div className="homepage">

                <Header />

                <div className="wrap">


                    <div className="fleft">


                    <div class="card">
                        <div class="card-content">
                            {isregister
                            &&
                            <Signup/>
                            }
                            {!isregister &&
                            <Login/>
                            }


                            <Divider><Typography>or</Typography></Divider>
                            <br></br>
                            <button class="card-button" onClick={handlecreate}>Create Account</button>
                            <br/>
                            <br/>
                        </div>
                    </div>
                    </div>

                    <Divider orientation="vertical" flexItem className="vertical-divider" />

                    <div className="fright">Right</div>


                </div>

                <Footer />
            </div>
        );

}

export default Homepage;
